glsl3.frag:
  precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
  #if USE_TEXTURE
      in vec2 v_uv0;
      uniform sampler2D texture;
  #endif
  in vec4 v_color;
  uniform Constant {
  vec4 uOutlineColor;
  float uEdge;
  float uOut;
};
  vec2 c_UV0_main_4() {
    return v_uv0;
}
vec4 c_OutlineColor_main_3(sampler2D Tex, vec2 UV, float Edge, vec4 OutlineColor)
{
    Edge = Edge / 100.0;
    vec4 accum = vec4(0.0);
    vec4 normal = vec4(0.0);
    normal = texture2D(Tex, UV);
    accum += texture2D(Tex, vec2(UV.x - Edge, UV.y - Edge));
    accum += texture2D(Tex, vec2(UV.x + Edge, UV.y - Edge));
    accum += texture2D(Tex, vec2(UV.x + Edge, UV.y + Edge));
    accum += texture2D(Tex, vec2(UV.x - Edge, UV.y + Edge));
    accum.rgb = OutlineColor.rgb * accum.a;
    return (accum * (1.0 - normal.a)) + (normal * normal.a);
}
vec4 c_Output_main_1(vec4 Color) {
    return Color;
}
void main()
{
    vec2 out_UV_UV0_4 = c_UV0_main_4();
    if(uOut > 0.5) {
        vec4 out_Output_OutlineColor_3 = c_OutlineColor_main_3(texture, vec2(out_UV_UV0_4), uEdge, vec4(uOutlineColor));
        gl_FragColor = c_Output_main_1(vec4(out_Output_OutlineColor_3));
    }else{
      vec4 normal = texture2D(texture, vec2(out_UV_UV0_4));
      gl_FragColor = normal;
    }
}

